import React from "react";

const Seedspage = () => {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h2>Seeds</h2>
      <h3>That are available</h3>
      <div style={{ marginBottom: '20px' }}>
        <h4>Watermelon Seeds</h4>
        <img 
          src="/watermelon.jpg"  // Make sure the image is correctly placed in your public folder or imported
          alt="Watermelon Seeds"
          style={{ width: '300px', height: 'auto', borderRadius: '10px' }}
        />
      </div>
      <div>
        <h4>Tomato Seeds</h4>
        <img 
          src="/tomato.jpg"  // Same thing here
          alt="Tomato Seeds"
          style={{ width: '300px', height: 'auto', borderRadius: '10px' }}
        />
      </div>
      <div>
        <h4>Carrot Seeds</h4>
        <img 
          src="/carrot.jpg"  // Same for this one
          alt="Carrot Seeds"
          style={{ width: '300px', height: 'auto', borderRadius: '10px' }}
        />
      </div>
    </div>
  );
};

export default Seedspage;
